// import external modules
import React, { Component } from "react";

import { NavLink } from "react-router-dom";

// Styling
import "../../../../../assets/scss/components/sidebar/sidemenu/sidemenu.scss";
import SideMenu from "../sidemenuHelper";
// import internal(own) modules

class SideMenuItem extends Component {
    render() {
        console.log("Dsfdsfd")
        return this.props.pages.length>0? this.props.pages.map((value, index) =>
            <SideMenu.MenuSingleItem badgeColor="danger" badgeText="6">
                <NavLink to="/{value.name}" activeclassname="active">
                    <span className="menu-item-text">{value.name}</span>
                </NavLink>
            </SideMenu.MenuSingleItem>
        ):<div></div>;

    }
}

export default SideMenuItem;
